import React from 'react';

class SocialMedia extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            social_media : [
                {'url': 'https://www.facebook.com/', 'name': 'facebook'},
                {'url': 'https://twitter.com/', 'name': 'twitter'},
                {'url': 'https://www.linkedin.com', 'name': 'linkedin'}
            ]
        }
    }

    render(){

        const items = this.state.social_media.map( (item, key) => 
            <li key={item.id}><a href={item.url} target="_blank" rel="noopener noreferrer"><span>{item.name}</span><i className={"fa fa-"+ this.state.name} aria-hidden="true"></i></a></li>
        );

        return(
            <ul className="social-icon">
                <li><a href="https://www.facebook.com/" target="_blank" rel="noopener noreferrer"><span>Facebook</span><i className="fa fa-facebook" aria-hidden="true"></i></a></li>
                <li><a href="https://twitter.com/" target="_blank" rel="noopener noreferrer"><span>Twitter</span><i className="fa fa-twitter" aria-hidden="true"></i></a></li>
                <li><a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer"><span>Linkedin</span><i className="fa fa-linkedin" aria-hidden="true"></i></a></li>
                <li><a href="https://slack.com/intl/en-in/" target="_blank" rel="noopener noreferrer"><span>Slack</span><i className="fa fa-slack" aria-hidden="true"></i></a></li>
                <li><a href="https://dribbble.com/" target="_blank" rel="noopener noreferrer"><span>Dribbble</span><i className="fa fa-dribbble" aria-hidden="true"></i></a></li>
                {items}
            </ul>
        );

    }
    
}

export default SocialMedia;
